import icon from './icon.jpg';

function navbar() {
    return (
        <nav className="navbar navbar-dark bg-dark">
            <div className="container-fluid">
                <div>
                    <img src={icon} className=""/>
                </div>
                <span className="navbar-brand">
                    Key Saver
                </span>
            </div>
        </nav>
    );
}

export default navbar;
